INSERT INTO `pcs_symphony_template_emails` VALUES (1,'Nuevo Ticket','Alta de Ticket','<p><span style=\"font-size: small;\">%ticket_type.name%</span></p>\r\n<p><span style=\"font-size: small;\"><strong><br /> </strong><strong>Estimado (a): %assignedUser.fullname%</strong></span><br /> <br /> <br /><span style=\"font-size: small;\"> Le estamos remitiendo los antecedentes y documentos relativos a la aclaraci&oacute;n con n&uacute;mero de ticket %ticket.id_ticket_client%.</span></p>\r\n<p><span style=\"font-size: small;\">Solicitamos se atienda a la mayor brevedad e informarnos si requiere alguna informaci&oacute;n o documentaci&oacute;n adicional.</span><br /> <br /><span style=\"font-size: small;\"> Atentamente</span></p>\r\n<p><span style=\"font-size: small;\"><strong>Centro de Atenci&oacute;n a Clientes.</strong></span></p>','ticket.create',1,1,1,0,'es'),(2,'Asignación','Ticket Asignado','<p><strong><span style=\"font-family: verdana, geneva; font-size: medium;\">%group.name% :</span></strong></p>\r\n<p><span style=\"font-size: small; font-family: verdana, geneva;\">&nbsp;</span></p>\r\n<p><span style=\"font-size: small; font-family: verdana, geneva;\">Se les informa que el ticket n&uacute;mero&nbsp;<strong>%ticket.id_ticket_client%</strong> ha sido asignado a su grupo de trabajo, especificamente al integrante <strong>%assignedUser.fullname%.</strong></span></p>\r\n<p><span style=\"font-size: small; font-family: verdana, geneva;\">La descripici&oacute;n del ticket es la siguiente:</span></p>\r\n<p><em><span style=\"font-size: small; font-family: verdana, geneva;\">%ticket.description%</span></em></p>\r\n<p><span style=\"font-size: small; font-family: verdana, geneva;\">Por favor consideren que la fecha de vencimiento de este ticket es: <strong>%info.expirationDate%</strong></span></p>\r\n<p><span style=\"font-size: small; font-family: verdana, geneva;\">Sin m&aacute;s por el momento, quedo en espera de su pronta respuesta.</span></p>\r\n<p><span style=\"font-family: verdana, geneva; font-size: medium;\">&nbsp;</span></p>\r\n<p><strong><span style=\"font-family: verdana, geneva; font-size: medium;\">Gracias &iexcl;&iexcl;&iexcl;</span></strong></p>\r\n<p>&nbsp;</p>','ticket.assign',1,0,0,1,'es'),(3,'Resolución','Ticket Resuelto','<p><span style=\"font-size: small; font-family: verdana, geneva;\"><strong style=\"font-family: verdana, geneva; font-size: small;\">Estimado (a): <br /></strong></span></p>\r\n<p><span style=\"font-size: small; font-family: verdana, geneva;\"><br />Se le informa que el ticket n&uacute;mero %ticket.id_ticket_client%,&nbsp;ha sido marcado como resuelto. Le pedimos de la manera m&aacute;s cordial validar la soluci&oacute;n del mismo.</span></p>\r\n<p><span style=\"font-size: small; font-family: verdana, geneva;\">&nbsp;</span></p>\r\n<p><span style=\"font-size: small; font-family: verdana, geneva;\"><span style=\"font-size: small; font-family: verdana, geneva;\"><strong style=\"font-family: verdana, geneva; font-size: small;\">%ticket.description%</strong></span></span></p>\r\n<p><span style=\"font-size: small; font-family: verdana, geneva;\"><span style=\"font-size: small; font-family: verdana, geneva;\"><strong style=\"font-family: verdana, geneva; font-size: small;\">&nbsp;</strong></span></span></p>\r\n<p><span style=\"font-size: small; font-family: verdana, geneva;\">Quedamos en espera de la aceptaci&oacute;n de dicha soluci&oacute;n o bien los comenaterios correspondientes para trabajar en la mejora de la misma.<br /><br /><br /></span><span style=\"font-size: small; font-family: verdana, geneva;\">Atentamente<br /><strong>Banco Autofin Mexico</strong></span></p>','ticket.resolve',1,0,1,1,'es'),(4,'Ticket Cerrado','Ticket Cerrado','<p><span style=\"font-size: small; font-family: verdana, geneva;\"><strong>Estimado (a): <br /></strong></span></p>\r\n<p><span style=\"font-size: small; font-family: verdana, geneva;\"><br />Se le informa que la atenci&oacute;n al ticket n&uacute;mero %ticket.id_ticket_client%,&nbsp;ha sido concluida, por lo tanto se efectuar&aacute; el cierre del mismo.</span></p>\r\n<p><span style=\"font-size: small; font-family: verdana, geneva;\">Sin m&aacute;s por el momento, quedamos en espera de sus futuras peticiones.<br /><br /><br />Atentamente<br /><strong>Banco Autofin Mexico</strong></span></p>','ticket.close',1,0,1,1,'es'),(7,'Normal','Atención - Escalamiento','<p>Grupo&nbsp;%group.name%</p>\r\n<p>El ticket&nbsp;%ticket.id_ticket_client% lleva un tiempo de vencimiento por&nbsp; %info.expiredTime%.</p>\r\n<p>Le pedimos de la manera m&aacute;s cordial atender el mismo a la brevedad.</p>\r\n<p>&nbsp;</p>\r\n<p>Gracias &iexcl;&iexcl;&iexcl;</p>','ticket.escalation',1,0,1,1,'es'),(8,'ANALISTA ACLARACIONES TDD','DISPOSICIION PSRCISL','<p>URGE ATENDER</p>','ticket.assign',2,1,0,0,'es');
/*!40000 ALTER TABLE `pcs_symphony_template_emails` ENABLE KEYS */;
